import React from "react";

function App() {


  function handleChange(event) {
    userName = event.target.value;
  }
  return (
    <div className="container">
      <h1>Hello </h1>
      <input
        onChange={handleChange}
        type="text"
        placeholder="What's your name?"
      />
      <button className="btn">Submit</button>
    </div>
  );
}

export default App;
